package com.nmims.app.Models;public class MyPermission{    private String permissionId;    private String permissionName;    private String permissionStatus;    public MyPermission() {    }    public MyPermission(String permissionId, String permissionName, String permissionStatus) {        this.permissionId = permissionId;        this.permissionName = permissionName;        this.permissionStatus = permissionStatus;    }    public String getPermissionId() {        return permissionId;    }    public void setPermissionId(String permissionId) {        this.permissionId = permissionId;    }    public String getPermissionName() {        return permissionName;    }    public void setPermissionName(String permissionName) {        this.permissionName = permissionName;    }    public String getPermissionStatus() {        return permissionStatus;    }    public void setPermissionStatus(String permissionStatus) {        this.permissionStatus = permissionStatus;    }}